class VDOM_formcheckbox(VDOM_object):

	def render(self, parent, contents=""):
		display = u" display: none; " if self.visible == "0" else u""
		weight = u" bold " if self.fontweight == "bold" else u""

		state = [u"", u"""checked="checked" """][int(self.state)]
		style = u"""overflow: hidden; z-index: {zind}; position: {pos}; top: {top}px; left: {left}px; 
					width: {width}px; height: {height}px; font: {weight} {size}px tahoma;{display} 
				""".format(zind = self.zindex, pos = self.position, top = self.top, left = self.left,
						width = self.width, height = self.height, weight = weight, size = self.fontsize, display = display)

		clean_id = (self.id).replace('-', '_')
		id = u"o_" + clean_id

		result = u"""<div id="%(id)s" style="%(style)s">
						<input name="%(name)s" type="checkbox" %(state)s tabindex="%(tabind)s" value="%(value)s" 
							id="inp_%(id)s" style="vertical-align:top;#vertical-align:middle" /> 
						<label for="inp_%(id)s" style="vertical-align:middle">%(label)s</label>
						%(contents)s
					</div>
					<script type="text/javascript">jQuery(document).ready(function(){
							jQuery('#inp_%(id)s').change(function(){
								execEventBinded('%(clean_id)s', 'change', { Value: jQuery('#inp_%(id)s').val() });
							});
						});
					</script>
				""" % {"id": id, "style": style, "name": self.name, "state": state, 
						"tabind": self.tabindex, "value": self.value, "label": self.label, 
						"contents": contents, "clean_id": clean_id}

		return VDOM_object.render(self, parent, contents=result)

	def wysiwyg(self, parent, contents=""):
		if int(self.state):
			state = u"""
						<line stroke="#000000" stroke-width="2" x1="{xa}" y1="{ya}" x2="{xb}" y2="{yb}"/>
						<line stroke="#000000" stroke-width="2" x1="{xb}" y1="{yb}" x2="{xc}" y2="{yc}"/>
					""".format(xa = 5, ya = 8, xb = 9, yb = 12, xc = 14, yc = 6)
		else:
			state = u""
		fontsize = u"""fontsize="%s" """ % self.fontsize if self.fontsize else u""
		label = u"<![CDATA[%s%s]>" % (self.label, "]")

		result = \
			u"""<container id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" order="{order}" 
						top="{top}" left="{left}" width="{width}" height="{height}">
					<svg>
						<rect x="{rec_left}" y="{rec_top}" width="{rec_wid}" height="{rec_hei}" fill="#EEEEEE" stroke="#000000"/>
						{state}
					</svg>
					<text top="{txt_top}" left="{txt_left}" width="{txt_wid}" height="{txt_hei}" 
						color="#000000" fontweight="{fweight}" {fsize}>{label}</text>
					{contents}
				</container>
			""".format(
				id = self.id, vis = self.visible, zind = self.zindex, 
				hierarchy = self.hierarchy, order = self.order, 
				top = self.top, left = self.left, width = self.width, height = self.height,
				rec_left = 2, rec_top = 2, rec_wid = 13, rec_hei = 13, state = state,
				txt_top = 0, txt_left = 16, txt_wid = int(self.width)-16, txt_hei = self.height, 
				fweight = self.fontweight, fsize = fontsize, label = label, contents = contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)
